							'/* stylelint-disable scss/at-extend-no-missing-placeholder */\n.cb-no-border {\n\tborder: none !important;\n}\n\n.cb-no-top-border {\n\tborder-top: none !important;\n}\n\n.cb-no-right-border {\n\tborder-right: none !important;\n}\n\n.cb-no-bottom-border {\n\tborder-bottom: none !important;\n}\n\n.cb-no-left-border {\n\tborder-left: none !important;\n}\n\n.cb-no-vertical-border {\n\t@extend .cb-no-top-border;\n\t@extend .cb-no-bottom-border;\n}\n\n.cb-no-horizontal-border {\n\t@extend .cb-no-right-border;\n\t@extend .cb-no-left-border;\n}\n\n.cb-no-padding {\n\tpadding: 0 !important;\n}\n\n.cb-no-top-padding {\n\tpadding-top: 0 !important;\n}\n\n.cb-no-right-padding {\n\tpadding-right: 0 !important;\n}\n\n.cb-no-bottom-padding {\n\tpadding-bottom: 0 !important;\n}\n\n.cb-no-left-padding {\n\tpadding-left: 0 !important;\n}\n\n.cb-no-vertical-padding {\n\t@extend .cb-no-top-padding;\n\t@extend .cb-no-bottom-padding;\n}\n\n.cb-no-horizontal-padding {\n\t@extend .cb-no-right-padding;\n\t@extend .cb-no-left-padding;\n}\n/* stylelint-enable scss/at-extend-no-missing-placeholder */\n',
